import React from "react";
import styled from "styled-components";
import { ArrowBackIosOutlined } from "@material-ui/icons";

const Container = styled.div`
  width: 100%;
  height: 100vh;
  display: flex;
  border: solid;
`;

const Arrow = styled.div``;

const Slider = () => {
  return (
    <Container>
      <Arrow>
        <ArrowBackIosOutlined />
      </Arrow>
    </Container>
  );
};

export default Slider;
